    [],nt"revision_timestamp": "2016-07-27T23:02:26.582380",nt"name": "observations-afield-on-alaskan-wolves",nt"isopen":
    false,nt"url": null,nt"notes": "Widespread observations of wolves and their
    habits in Alaska during the period 1948-1954 generally confirm published reports
    of these phenomena elsewhere. Significant finding in Alaska include: the late pupping
    season May and June; the predominance of black wolves in the forested sections and
    of gray wolves on the Arctic tundra; the well-defined wolf trails on the islands
    of Southeastern Alaska and their movements in the arctic governed by the pattern
    of caribou migrations; distribution limited by physical barriers and the presence
    of big game animals, principally caribou; wolves occur most frequently in pairs
    and the average pack numbers five animals; the largest wolf weighed was 112 pounds
    with the average weight of males being 90 lbs. and females 67 pounds.",nt"license_title":
